import {BrowserRounter, Route, Switch} from 'react-router-dom';
import StorePicker from './StorePicker'

const Router = () => (
    <BrowserRounter>
        <Switch>
            <Route exact path="/" component={StorePicker} />
        </Switch>
    </BrowserRounter>
)
